import React, { Component } from 'react';
import Todos from './components/Todos'
import './App.css';

class App extends Component {
  state = {
    todos: [
      {
        id:1,
        title:'Complete the ReactJS project',
        completed:false
      },
      {
        id:2,
        title:'Hang out with my GF',
        completed:false
      },
      {
        id:3,
        title:'buy coffee',
        completed:false
      },
    ]
  }

  render() {
    return (
      <div className="App">
        <h1>My App</h1>
        <Todos todos={this.state.todos}/>
      </div>
    );
  }
}

export default App;
